import Layout from "../components/Layout";

const About = () => (
  <Layout>
    <div>
      <h1>About The Toss It! Project</h1>
      <p>
        The premise is simple... Take a styrofoam cup, write the meanest thing
        someone has said to you. Then...
      </p>
      <h2>TOSS IT!!</h2>
    </div>
  </Layout>
);

export default About;
